import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Card from './Cards';
import './index.css'
import Sdata from "./Sdata"

function ncard(val){
  return (
    <Card
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link} />
  );

}
ReactDOM.render(
  <>
    <h1 className='heading_style'> Our Room 210 -The Golden Room </h1>
    {Sdata.map(ncard)}
  </>,
  document.getElementById('root')
);
